import React from "react";
import Navbar from "./essentials/Navbar";
import main_bg from "../images/main_bg.svg";
import logo from "../"
import Typewriter from "typewriter-effect";

export default function Home() {
  return (
    <>
      <title>Home</title>
      <img src={main_bg} class="background-image" />
      <div className="vh-100 d-flex justify-content-center align-items-center welcome-page">
        <center>
          <h1>
            <b>BrainTeaser : Where Minds Get Twisted and Logic Unleashed!</b>
          </h1>
          <h4>
            <Typewriter
              options={{
                strings: [
                  "Welcome to BrainTwister! üß†üî• The Ultimate Playground for Mind Benders!",
                  "Prepare to have your gray matter challenged! ü§Ø Brainteasers await!",
                  "Put on your thinking caps and get ready to twist! üß†üí≠ Logic meets fun!",
                  "Embark on a journey of mental gymnastics! ü§∏‚Äç‚ôÇÔ∏è Stretch your brain muscles!",
                  "Unleash your inner genius! üí° BrainTwister will blow your mind!",
                ],
                autoStart: true,
                loop: true,
              }}
            />
          </h4>
          <br/>
          <div className="d-flex justify-content-center">
            <button className="qbtn qbtn-db me-2">Login</button>
            <button className="qbtn qbtn-db">SignUp</button>
          </div>
        </center>
      </div>
    </>
  );
}
